  input: TEXT,F3XA,,"September 19, 2005 Ms. Jodi Winship, Campaign Finance Analyst,
    Reports Analysis Division, Federal Election Commission Dear Ms. Winship, This
    is in response to your letter dated August 19, 2005 requesting additional information
    regarding the April monthly report of the Investment Company Institute Political
    Action Committee ('ICI PAC'). You asked about information missing from the report,
    specifically the state/district information for certain candidate contributions
    disclosed on the report. We have reviewed our software and do not have a clear
    explanation for why this information-which was transmitted properly in previos
    reports-did not come through in the data submitted for the above-referenced report.
    Further, we did not received any 'warning' message regarding the missing data
    from FEC's validation process while the report was being filed and, as a result,
    were unable to correct the ommissions on the report. To avoid a similar problem
    in the future, we have reviewed all state/district entries in the PAC's database
    and reinserted manually those instances where information was missing. In filing
    future reports, we will review this information more closely before filing to
    ensure that the information is complete upon filing. Should you have any questions
    or need additional information, please do not hesitate to contact the undersigned
    at (202)326-5800. Sincerely, Lawrence R. Maffia ICI PAC Treasurer"
